import React from "react";
import { Link } from "react-router-dom";
<link rel="stylesheet" href="footer.css" defer />

const Footer = (props) => {
  return (
    <div className="footer">
      <div className="footer-content panel">
        <div className="panel-inset m0 footer-links">
          <a href="contacts">Contact</a>
          <span className="separator">|</span>
          <a href="https://www.linkedin.com/in/joao-duarteee">LinkedIn</a>
          <span className="separator">|</span>
          <a href="">Filler</a>
          <span className="separator">|</span>
          <a href="">Sample</a>
        </div>
        <div className="footer-middle panel-inset m0 p0"></div>
        <div className="footer-copyright panel-inset m0">
          Copyright © 2022 - 2023 João Duarte Software - all rights
          reserved.
        </div>
      </div>
    </div>
  );
};

export default Footer;

// Add the following line to the head of your HTML file
// <link rel="stylesheet" href="footer.css" defer />
